import React from 'react';
import Header from '../components/Header';


const Coupons = () => {
    return (
        <div>
          <Header />
           <section className='container'>
            <h1 className>This is the Coupons section</h1>
           </section> 
           <section>
             <p>This is where the coupons images will be stored</p>
           </section>
        </div>
    )
}

export default Coupons
